Before I take the plunge and go through with my actual at-home brow lamination (which I will also be filming), I had to finally share my current brow routine aka the reason I bought the brow lamination kit in the first place lol! The amount of feedback I receive on the daily about how I achieve this feathered, fluffy, bushy, “editorial supermodel” and yes, “laminated” brow look is exactly why this tutorial was born.
In this video, I share my entire brow routine as well as a new secret weapon I discovered (courtesy of @amandaensing) for holding them in place all damn day! Goodbye, brow gel! This stuff is amazing, costs about $5 for this huuuge bottle and will basically last you your entire life!
Enjoy! Leave any questions for me down below in the comments! I’ll be replying 👀🥰😘
